import React from "react";
import { Container, Typography, Paper, Box, Button } from "@mui/material";
import TextField from "@mui/material/TextField";
import Radio from "@mui/material/Radio";
import RadioGroup from "@mui/material/RadioGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import { useState } from "react";
import AppBar1 from "./Appbar";
import { useNavigate } from "react-router-dom";

const paperStyle = {
  padding: "50px 20px",
  width: 600,
  margin: "20px auto",
};

export default function AdminP() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [role, setRole] = useState("ADMIN");
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleLogout = async () => {
    const accessToken = localStorage.getItem("access_token");
    const response = await fetch("http://localhost:8080/logout", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${accessToken}`,
      },
    });

    if (response.ok) {
      localStorage.removeItem("access_token");
      localStorage.removeItem("refresh_token");
      console.log("Logout successful");
      navigate("/login");
    } else {
      console.log("Logout failed");
    }
  };

  const handleClick = (e) => {
    e.preventDefault();
    if (!firstName || !lastName || !username || !password) {
      setError("Please fill out all fields.");
      return;
    }

    const infos = { firstName, lastName, username, password, role };
    console.log(infos);

    fetch("http://localhost:8080/register", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(infos),
    })
      .then((response) => {
        if (response.ok) {
          navigate("/login");
        } else {
          return response.json().then((data) => {
            console.log("Response data:", data);
            setError(data.message || "Registration failed. Please try again.");
          });
        }
      })
      .catch((error) => {
        setError("An error occurred. Please try again.");
        console.error("Error:", error);
      });
  };

  return (
    <div>
      <AppBar1 />
      <Container maxWidth="md">
        <Box mt={4}>
          <Paper elevation={3}>
            <Box p={4}>
              <Typography variant="h4" gutterBottom>
                Admin Panel
              </Typography>
              <Typography variant="body1">
                Welcome to the admin dashboard. Here you can manage users,
                settings, and more.
              </Typography>
              <Button
                variant="contained"
                color="primary"
                onClick={handleLogout}
              >
                Logout
              </Button>
            </Box>
          </Paper>
        </Box>

        <Paper elevation={3} style={paperStyle}>
          <h1 style={{ color: "#1976d2" }}>Admin Register</h1>
          {error && <p style={{ color: "red" }}>{error}</p>}
          <Box
            component="form"
            sx={{
              "& > :not(style)": { m: 1 },
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="first-name"
              label="First Name"
              variant="outlined"
              fullWidth
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
            />
            <TextField
              id="last-name"
              label="Last Name"
              variant="outlined"
              fullWidth
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
            />
            <TextField
              id="username"
              label="User Name"
              variant="outlined"
              fullWidth
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <TextField
              id="password"
              label="Password"
              variant="outlined"
              fullWidth
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <RadioGroup
              aria-labelledby="demo-radio-buttons-group-label"
              defaultValue="USER"
              name="radio-buttons-group"
              value={role}
              onChange={(e) => setRole(e.target.value)}
            >
              <FormControlLabel value="USER" control={<Radio />} label="User" />
              <FormControlLabel
                value="ADMIN"
                control={<Radio />}
                label="Admin"
              />
            </RadioGroup>
            <Button variant="contained" onClick={handleClick}>
              Register
            </Button>
          </Box>
        </Paper>
      </Container>
    </div>
  );
}
